👉Uccio anticipa il Black Friday con sconti + un ulteriore 10% su quasi tutto, con il codice PLAYERINSIDE10, QUI: https://bit.ly/4oGPixo
---
Una domenica PIENA di news, alcune delle quali già anticipate nel corso della settimana appena trascorsa. Una bella domenica pregna che speriamo, almeno per voi, possa essere di relax e/o divertimento e/o quel che volete voi. BUONA DOMENICA con le NEWS DELLA SETTIMANA (since 2013).

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro con annuncio Gamics Cesena;
0:45 - SPONSOR: illivellosegreto;
2:20 - Annunciato Horizon Steel Frontiers, MMORPG per PC e mobile (e forse un altro Horizon);
3:42 - Valve presenta la sua nuova Steam Machine, in uscita nel 2026;
5:04 - Half Life 3 sarà annunciato entro quest'anno?
5:26 - The Elder Scrolls VI uscirà solo nel 2028/29, secondo un insider;
5:50 - Fallout 4 Anniversary Edition è un disastro al lancio;
6:10 - Fine della Console War: Reggie Fils-Aimé sostiene che sia una cosa "negativa";
7:13 - Sony pubblica i risultati: disastro Bungie e profitti in calo;
7:55 - Stop Destroying Videogames: il governo inglese diche che nulla è nostro davvero;
9:50 - Il governo indonesiano vuole vietare i videogiochi violenti. Ecco perché;
10:16 - Red Dead Redemption annunciato per Ps5, Xbox Series X/s, iOS e Android;
10:49 - PS5 è "a metà del suo ciclo vitale", dice Sony;
11:41 - Secondo Sony "il gioco più importante per PS5 deve ancora uscire";
12:04 - Concord viene recuperato da alcuni fan su server privati, ma Sony si oppone;
12:59 - Xbox Rog Ally vende meglio del previsto, soprattutto il modello più costoso;
13:30 - GTA 6: la notizia del rinvio discussa al parlamento polacco. Più o meno;
14:01 - GTA 6 sarà "ventanni avanti" rispetto a tutto il resto dei videogiochi;
14:48 - Super Mario Galaxy, il nuovo trailer del film d'animazione;
15:03 - PS Plus Extra & Premium: ecco le novità di novembre 2025;
15:21 - Arrestato per aver giocato ad un videogioco proibito: è successo in Norvegia;
16:48 - Saluti prolissi, un po' nostalgici e Sony mostra un aumento...
…
-Raiden & Midna


